import React from 'react';

import { checkAnswers } from './check-answers';

const generateRecommendations = () => {
    checkAnswers();

    const generateRecommendationLayout = () => {
        let _layout = [];

        for (let i = 0; i < recommendationsForUser.length; i++) {
            _layout.push(<li>{recommendationsForUser[i]}</li>);
        }

        return _layout;
    };

    return (
        <ol>
            {generateRecommendationLayout()}
        </ol>
    );
};

export { generateRecommendations };
